function Content(props) {
    return <h1>Content section {props.username} {props.phone}</h1>
}

Content.defaultProps = {
    username: 'nitinnitin',
    phone: '909090'
}

Content.propTypes = {
    username: propTypes.string  /* array, bool, func, number, object, string, symbol  */
}


export default Content
